    this.Qty            = _custPackingSlipTransHistory.Qty;
    this.Remain         = _custPackingSlipTransHistory.Remain;
    this.ValueMST       = _custPackingSlipTransHistory.ValueMST;
    this.InventQty      = _custPackingSlipTransHistory.InventQty;
    this.RemainInvent   = _custPackingSlipTransHistory.RemainInvent;
    this.PdsCWQty       = _custPackingSlipTransHistory.PdsCWQty;
    this.PdsCWRemain    = _custPackingSlipTransHistory.PdsCWRemain;
    this.Weight         = _custPackingSlipTransHistory.Weight;
    this.StatValueMST   = _custPackingSlipTransHistory.StatValueMST;
}

