display server InventQty remainInventFinancial()
{
    InventQty           invoicedQty;

    invoicedQty = CustInvoicePackingSlipQuantityMatch::inventoryQuantityMatched(this.SourceDocumentLine);
    return this.InventQty - invoicedQty;
}

InventQty remainInventFinancial_RU(InventDim _inventDimCriteria = null, InventDimParm _inventDimParm = null)
{
    InventTransOrigin inventTransOrigin;
    InventTrans       inventTrans;
    InventDim         inventDim;

    if (_inventDimParm.isAllFlagNo())
    {
        return this.remainInventFinancial();
    }

    select TableId from inventTransOrigin
        where inventTransOrigin.InventTransId == this.InventTransId
    join sum(Qty) from inventTrans
        where inventTrans.InventTransOrigin == inventTransOrigin.RecId &&
              inventTrans.PackingSlipId == this.PackingSlipId &&
              inventTrans.VoucherPhysical &&
              !inventTrans.Voucher
    #inventDimExistsJoin(inventTrans.InventDimId, inventDim, _inventDimCriteria, _inventDimParm);

    return -inventTrans.Qty;
}

display server SalesQty remainSalesFinancial()
{
    SalesQty        invoicedQty = CustInvoicePackingSlipQuantityMatch::salesQuantityMatched(this.SourceDocumentLine);

    return this.Qty - invoicedQty;
}

SalesQty remainSalesFinancial_RU(InventDim _inventDimCriteria = null, InventDimParm _inventDimParm = null)
{
    InventTransOrigin inventTransOrigin;
    InventTrans       inventTrans;
    InventDim         inventDim;
    if (_inventDimParm.isAllFlagNo())
    {
        return this.remainSalesFinancial();
    }

    select TableId from inventTransOrigin
        where inventTransOrigin.InventTransId == this.InventTransId
    join sum(Qty) from inventTrans
        where inventTrans.InventTransOrigin == inventTransOrigin.RecId &&
              inventTrans.PackingSlipId     == this.PackingSlipId &&
              inventTrans.VoucherPhysical &&
              !inventTrans.Voucher
    #inventDimExistsJoin(inventTrans.InventDimId, inventDim, _inventDimCriteria, _inventDimParm);

    if (this.isStocked())
    {
        return -EcoResProductUnitConverter::convertGivenUnitSymbolsForReleasedProduct(
            this.ItemId,
            this.InventDimId,
            inventTrans.Qty,
            this.inventTable().inventUnitId(),
            this.SalesUnit,
            NoYes::Yes);
    }
    else
    {
        return 0;
    }
}

