static CustPackingSlipTrans findInventTransId_RU(InventTransId  _inventTransId,
                                                 boolean        _forUpdate = false)
{
    CustPackingSlipTrans custPackingSlipTrans;

    custPackingSlipTrans.selectForUpdate(_forUpdate);

    select custPackingSlipTrans
        where custPackingSlipTrans.InventTransId == _inventTransId;

    return custPackingSlipTrans;
}

public static CustPackingSlipTrans findRecId(
    RecId       recId,
    boolean     update = false )
{
    CustPackingSlipTrans custPackingSlipTrans;

    custPackingSlipTrans.selectForUpdate(update);

    select custPackingSlipTrans
        where custPackingSlipTrans.RecId== recId;

    return custPackingSlipTrans;
}

/// <summary>
/// Retrieves a container that contains the <c>InventNow</c> and <c>DeliveryQty</c> values of the
/// <c>SalesParmSubLine</c> table.
/// </summary>
/// <param name="_salesId">
/// The sales ID of a <c>SalesTable</c> record.
/// </param>
/// <returns>
/// A container that contains the <c>InventQty</c> and <c>DeliveryQty</c> values of the
/// <c>CustPackingSlipTrans</c> table.
/// </returns>
public static container inventAndDeliverQty(SalesIdBase _salesId)
{
    SalesParmSubLine        salesParmSubLineLoc;
    container               conInventDeliverQty;
    CustPackingSlipTrans    custPackingSlipTransQty;
    CustPackingSlipTrans    custPackingSlipTransLoc;
    CustInvoiceJour         custInvoiceJourLoc;
    CustInvoiceTrans        custInvoiceTransLoc;

    while select RecId from custPackingSlipTransLoc
        join RecId, SalesId, InvoiceId from custInvoiceTransLoc
        where custInvoiceTransLoc.RecId   == custPackingSlipTransLoc.InvoiceTransRefRecId
           && custInvoiceTransLoc.SalesId == _salesId
        join RecId, SalesId, InvoiceId from custInvoiceJourLoc
            where custInvoiceJourLoc.SalesId == custInvoiceTransLoc.SalesId
                    && custInvoiceJourLoc.InvoiceId == custInvoiceTransLoc.InvoiceId
    {
        select firstonly InventNow, DeliverNow from salesParmSubLineLoc
            where salesParmSubLineLoc.JournalRefTableId == tableNum(CustPackingSlipTrans)
               && salesParmSubLineLoc.JournalRefRecId   == custPackingSlipTransLoc.RecId;

        if (salesParmSubLineLoc)
        {
            conInventDeliverQty += [custPackingSlipTransLoc.RecId, salesParmSubLineLoc.InventNow, salesParmSubLineLoc.DeliverNow];
        }
        else
        {
            select firstonly Qty, InventQty from custPackingSlipTransQty
                    where custPackingSlipTransQty.RecId == custPackingSlipTransLoc.RecId;

            if (custPackingSlipTransQty)
            {
                conInventDeliverQty += [custPackingSlipTransQty.RecId, custPackingSlipTransQty.InventQty, custPackingSlipTransQty.Qty];
            }
        }
    }

    return conInventDeliverQty;
}

/// <summary>
/// Retrieves the number of records of the <c>custPackingSlipTrans</c> table for a specified record ID
/// of a <c>CustInvoiceTrans</c> record.
/// </summary>
/// <param name="_custInvoiceTrans">
/// A <c>CustInvoiceTrans</c> record.
/// </param>
/// <returns>
/// The number of records of a <c>CustPackingSlipTrans</c> table for the specified record ID of a
/// <c>CustInvoiceTrans</c> record.
/// </returns>
static NumberOfRecords subLines(CustInvoiceTrans _custInvoiceTrans)
{
    return (select count(RecId) from custPackingSlipTrans
                where custPackingSlipTrans.InvoiceTransRefRecId == _custInvoiceTrans.RecId).RecId;
}

/// <summary>
///  Gets the total inventory quantity that has been posted on the packing slip for given sales order
/// </summary>
/// <param name="_inventTransId">
/// The InventTransId of the given sales order.
/// </param>
/// <returns>
/// Total inventory quantity that has been posted on the packing slip.
/// </returns>
public static InventQty totalQuantityPostedOnPackingSlip(InventTransId _inventTransId)
{
    CustPackingSlipTrans custPackingSlipTrans;

    select sum(Qty) from custPackingSlipTrans
        where custPackingSlipTrans.InventTransId == _inventTransId;

    return custPackingSlipTrans.Qty;
}

